import React from "react";
import { useForm } from "react-hook-form";
import {Link} from 'react-router-dom';

import arrow from '../../assets/home/icons/CheckIn/grey_arrow.svg'
import NoTickets from '../account/NoTickets';
import check from '../../assets/home/icons/CheckIn/check_mail.svg'
import Home from "../home";


export default function ApprovedPassword () {

//якщо користувач новий - то лінк на немає квитків(localstorage),інше -  з квитками
    
    return(
<section className="auth">
    <form method="get" >
        <img src={check} alt="password succecfully reset"/>
        <h1>Password Reset</h1>
        <h4> Your password has been successfully reset.
        Click below to login in magically.</h4>
            <Link to='/' element={<Home/>}>
                <button className="general_btn" type="submit">
                    Continue
                </button>
            </Link>
        <section className="additionals">
                <Link to="/account" element={<NoTickets/>}>
            <button>
                <img src={arrow} alt="back to login"/> Back to Login
            </button>
                </Link>
        </section>
    </form>
    
</section>
    )
}
